slots:
  CTAquisitionProtocolElement_ctdiPhantomTypeCode:
    description: The type of phantom to use for CTDI measurement according to IEC
      60601-2-44
    range: string
    required: false
  CTAquisitionProtocolElement_ctdiVol:
    description: The average dose over the total volume scanned for the selected CT
      conditions of operation (calculated according to IEC 60601-2-44, Ed.2.1 (Clause
      29.1.103.4)). The units are energy dose, e.g. mGy.
    range: string
    required: false
  CTAquisitionProtocolElement_exposureModulationType_Code:
    description: The manner in which tube current is varied in order to limit the
      dose.
    range: CTAquisitionProtocolElement_exposureModulationType_Code_enum
    required: false
  CTAquisitionProtocolElement_gantryDetectorTilt:
    description: Nominal angle of tilt in degrees of the scanning gantry. The units
      are of plane angle , e.g. degrees.  Zero degrees means the gantry is not tilted,
      negative degrees are when the top of the gantry is tilted away from where the
      table enters the gantry.
    range: string
    required: false
  CTAquisitionProtocolElement_kVp:
    description: Peak kilovoltage output of the x-ray generator. The units are of
      electrical potential.
    range: string
    required: false
  CTAquisitionProtocolElement_singleCollimationWidth:
    description: The width of a single row of acquired data. The units are of linear
      distince, e.g. mm.
    range: string
    required: false
  CTAquisitionProtocolElement_spiralPitchFactor:
    description: Ratio of the distance that the table moves during a complete revolution
      of the source around the gantry orbit, to the width of the total collimation
      over the area of active x-ray detection. The units are of unity.
    range: string
    required: false
  CTAquisitionProtocolElement_totalCollimationWidth:
    description: The width of the total collimation over the area of active x-ray
      detection. The units are of linear distince, e.g. mm.
    range: string
    required: false
  CTImageReconstructionProtocolElement_convolutionKernel:
    description: A label describing the mathematical operations used to reconstruct
      images from the acquired data. The values for this attribute are vendor specific
      and not coded.
    range: string
    required: false
  CTImageReconstructionProtocolElement_convolutionKernelGroupCode:
    description: A coded value specifying the family of mathematical operations to
      use to reconstruct images from the acquired data
    range: string
    required: false
  MRImageAcquisitionProtocolElement_acquisitionContrastCode:
    description: A coded value specifying the inherent (as opposed to exogenous) contrast
      in the acquisition.
    range: MRImageAcquisitionProtocolElement_acquisitionContrastCode_enum
    required: false
  MRImageAcquisitionProtocolElement_arterialSpinLabelingContrastCode:
    description: A coded value specifying how arterial water is used as a diffusable
      tracer.
    range: string
    required: false
  MRImageAcquisitionProtocolElement_diffusionBValue:
    description: The factor by which the acquisition is sensitized to the Brownian
      motion of water molecules. The units are of time/area, e.g. s/mm2
    range: string
    required: false
  MRImageAcquisitionProtocolElement_diffusionDirectionalityCode:
    description: A coded value specifying whether diffusion conditions for the frame
      are directional, or isotropic with respect to direction
    range: MRImageAcquisitionProtocolElement_diffusionDirectionalityCode_enum
    required: false
  MRImageAcquisitionProtocolElement_echoPlanarPulseSequenceIndicator:
    description: Specifies whether multiple echos of different phase steps are acquired
      using rephasing gradients instead of repeated 180-degree pulses.
    range: string
    required: false
  MRImageAcquisitionProtocolElement_echoPulseSequenceCategoryCode:
    description: A coded value specifying an echo category of pulse sequences.
    range: MRImageAcquisitionProtocolElement_echoPulseSequenceCategoryCode_enum
    required: false
  MRImageAcquisitionProtocolElement_inversionRecoveryIndicator:
    description: Specifies whether an inversion recovery preparatory sequence is used
      in the acquisition.
    range: string
    required: false
  MRImageAcquisitionProtocolElement_magneticFieldStrength:
    description: "A vector quantity indicating the ability of a magnetic field to\
      \ exert a force on moving electric charges. [The American Heritage\xAE Science\
      \ Dictionary]. The units are of magnetic flux density, e.g. tesla."
    range: string
    required: false
  MRImageAcquisitionProtocolElement_multipleSpinEchoIndicator:
    description: Specifies whether different lines in k-space are collected for a
      single frame.
    range: string
    required: false
  MRImageAcquisitionProtocolElement_phaseContrastIndicator:
    description: Specifies whether this is a pulse sequence in which the flowing spins
      are velocity encoded in phase.
    range: string
    required: false
  MRImageAcquisitionProtocolElement_pulseSequenceName:
    description: Name of the pulse sequence that is used for the acquisition. This
      is usually a vendor-specific name.
    range: string
    required: false
  MRImageAcquisitionProtocolElement_resonantNucleusCode:
    description: A coded value specifying the atomic nucleus that is the target of
      the acquisition
    range: MRImageAcquisitionProtocolElement_resonantNucleusCode_enum
    required: false
  MRImageAcquisitionProtocolElement_saturationRecoveryIndicator:
    description: Specifies whether a saturation recovery pulse sequence is used
    range: string
    required: false
  MRImageAcquisitionProtocolElement_spectrallySelectedSuppressionCode:
    description: A coded value specifying the type of substance-specific signal suppression
      is used.
    range: MRImageAcquisitionProtocolElement_spectrallySelectedSuppressionCode_enum
    required: false
  MRImageAcquisitionProtocolElement_steadyStatePulseSequenceCode:
    description: A coded value specifying how residual transverse magnetization is
      maintained during the acquisition.
    range: MRImageAcquisitionProtocolElement_steadyStatePulseSequenceCode_enum
    required: false
  MRImageAcquisitionProtocolElement_timeOfFlightContrastIndicator:
    description: Specifies whether contrast is created by the inflow of blood in the
      saturated plane.
    range: string
    required: false
  MRImageReconstructionProtocolElement_complexImageComponentCode:
    description: A coded value specifying the channel of the quadrature detected data,
      or the combination derived from those channels, used to reconstruct the image
    range: MRImageReconstructionProtocolElement_complexImageComponentCode_enum
    required: false
  PETImagingAcquisitionProtocolElement_gantryDetectorTilt:
